import { BrowserRouter as Router, Route } from "react-router-dom";
import Login from "./components/login";


function App() {
  return (
    <Router>
    <div>
      <Route exact path="/">
        <Login />
      </Route>
      {/* <Route path="/news">
        < />
      </Route> */}
    </div>
  </Router>
  );
}

export default App;
